acronymTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Acronyms</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    {{#if mraOutputs.assessment.targetLevel}}      <div class=\"col-sm-6 hidden-xs\">        <div class=\"row\">        <div class=\"col-xs-12 meta\">                  Target MRL: {{mraOutputs.assessment.targetLevel}} <span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}                </div>        </div>      </div>    {{/if}}  </div>  {{#if mraOutputs.assessment.targetLevel}}    <div class=\"collapse\"  id=\"subheader-collapseable\">    <div class=\"row visible-xs\">      <div class=\"col-xs-12\">          Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}      </div>    </div>    </div>  {{/if}}  </div></header><div class=\"container\" id=\"mainContent\">    <!-- Should add a search/filter in here -->		<div class=\"acronymTable row-striped\">    {{#each mraOutputs.acronyms}}  		<div><div class=\"row\">  			<div class=\"col-sm-3\">{{acronym}}</div>  			<div class=\"col-sm-9\">{{value}}</div>  		</div>  		</div>    {{/each}}	</div>  <input type='hidden' id='inputPage' value='acronymPage'></div>";
criteriaTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Criteria</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    {{#if mraOutputs.assessment.targetLevel}}      <div class=\"col-sm-6 hidden-xs\">        <div class=\"row\">        <div class=\"col-xs-12 meta\">                  Target MRL: {{mraOutputs.assessment.targetLevel}} <span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}                </div>        </div>      </div>    {{/if}}  </div>  {{#if mraOutputs.assessment.targetLevel}}    <div class=\"collapse\"  id=\"subheader-collapseable\">    <div class=\"row visible-xs\">      <div class=\"col-xs-12\">          Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}      </div>    </div>    </div>  {{/if}}  </div></header><div class=\"container\" id=\"mainContent\">		<div class=\"row\">		<div class=\"col-sm-6\">			<a class=\"document-link\" href=\"#\"><span class=\"glyphicon glyphicon-file\"></span> MRL Desktop V2.4</a>		</div>		<div class=\"col-sm-6 milestoneCol\">			<span class=\"dl-label\">Milestones</span>			<dl class=\"milestoneList\">				<dt>A</dt>				<dd>MRL 5</dd>				<dt>B</dt>				<dd>MRL 7</dd>				<dt>C</dt>				<dd>MRL 9</dd>			</dl>		</div>		</div>	<div class=\"criteria-filter-head\">		<div class=\"filter-top\">		<div class=\"row\">			<div class=\"col-xs-12\">				<a class=\"criteria-controls filter-button collapsed\" data-toggle=\"collapse\" data-target=\"#collapseFilter\">Filter</a>					<!-- <div class=\"expand-controls pull-right\">			<a href=\"javascript:void(0)\" class=\"criteria-controls expand-all\"><span class=\"glyphicon glyphicon-collapse-down\"></span> Expand all</a>			<a href=\"javascript:void(0)\" class=\"criteria-controls collapse-all\"><span class=\"glyphicon glyphicon-collapse-up\"></span> Collapse all</a>			</div> -->			</div>		</div>		</div>		<div class=\"criteria-filter-container collapse\" id=\"collapseFilter\">		<!-- <div class=\"filter-block\">		<div class=\"row\">			<div class=\"col-xs-12\">			<div class=\"filter-label\">Filter by Thread</div>			</div>		</div>		<div class=\"row\">			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Technology Maturity				    </label>				  </div>				  <div class=\"checkbox\">				      <label>				        <input type=\"checkbox\"> Technology &amp; Industrial Base				      </label>				    </div>				    <div class=\"checkbox\">				        <label>				          <input type=\"checkbox\"> Design				        </label>				      </div>			</div>			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Technology Maturity				    </label>				  </div>				  <div class=\"checkbox\">				      <label>				        <input type=\"checkbox\"> Technology &amp; Industrial Base				      </label>				    </div>				    <div class=\"checkbox\">				        <label>				          <input type=\"checkbox\"> Design				        </label>				      </div>			</div>			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Technology Maturity				    </label>				  </div>				  <div class=\"checkbox\">				      <label>				        <input type=\"checkbox\"> Technology &amp; Industrial Base				      </label>				    </div>				    <div class=\"checkbox\">				        <label>				          <input type=\"checkbox\"> Design				        </label>				      </div>			</div>			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Manufacturing Management				    </label>				  </div>				 </div>			</div>		</div> -->		<div class=\"filter-block form-inline\">		<div class=\"row \">		<div class=\"col-xs-12\">		<div class=\"filter-label\">Filter by MRL</div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-init='mrl_all=true' ng-model='mrl_all'>All</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_0'>1</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_1'>2</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_2'>3</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_3'>4</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_4'>5</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_5'>6</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_6'>7</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_7'>8</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_8'>9</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_9'>10</label>      </div>		</div>		</div>		</div>		</div>	</div>	<div class=\"criteria-list\">      {{#each mraOutputs.threads}}		 <div class=\"navigation-group\">			      <h4 class=\"group-title\">			        <a role=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThread{{@index}}\" aria-expanded=\"true\" aria-controls=\"collapseThread{{@index}}\" class=\"collapse-item collapsed\">			          {{name}}			        </a>			      </h4>			    <ul id=\"collapseThread{{@index}}\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne\">            {{#each subThreads}}			     <li>			     	<a role=\"button\" data-toggle=\"collapse\" data-target=\"#collapseSubThread_{{@../index}}_{{@index}}\" aria-expanded=\"true\" aria-controls=\"collapseSubThread_{{@../index}}_{{@index}}\" class=\"collapse-item collapsed\">			     	  {{name}}			     	</a>			     	<dl id=\"collapseSubThread_{{@../index}}_{{@index}}\" class=\"collapse\">              {{#each subThreadLevels}}                {{#if criteriaText}}    							<dt level-id=\"mrl_{{@index}}\">MRL {{mrlLevel}}</dt>    							<dd level-id=\"mrl_{{@index}}\">{{{criteriaText}}}</dd>                {{/if}}              {{/each}}			     	</dl>			     	<!-- <ul id=\"collapseTwo\" class=\"collapse\">							<li><a role=\"button\" data-toggle=\"collapse\" href=\"#collapseThree\" aria-expanded=\"true\" aria-controls=\"collapseThree\" class=\"collapse-item collapsed\">			     	  Technology Transition to Production			     	</a>							<ul id=\"collapseThree\" class=\"collapse\">								<li><a href=\"#\">Question 1</a></li>								<li><a href=\"#\">Question 2</a></li>								<li><a href=\"#\">Question 3</a></li>								<li><a href=\"#\">Question 4</a></li>							</ul>			     	</li>							<li>3</li>							<li>4</li>							<li>5</li>			     	</ul> -->			     	</li>            {{/each}}			    </ul>			 </div>       {{/each}}	</div>  <input type='hidden' id='inputPage' value='criteriaPage'><script type=\"text/javascript\">  $(document).ready(function() {      var checkBoxes = document.querySelectorAll('input[ng-model*=mrl_]');      var tds = document.querySelectorAll('[level-id*=mrl_]');      for (var i=0; i<checkBoxes.length; i++) {        var checkBox = checkBoxes[i];        var ngModel = checkBox.getAttribute('ng-model');        if (ngModel == 'mrl_all') {            checkBox.addEventListener(\"click\", allClicked);        } else {            checkBox.addEventListener(\"click\", singleLevelClicked);        };      };      function allClicked(event) {          if (!event.target.checked) {              for (var j=0; j<tds.length; j++) {                var td = tds[j];                td.style.display = \"none\";              };          } else {              for (var j=0; j<tds.length; j++) {                var td = tds[j];                td.style.display = \"\";                td.checked = true;              };              for (var k=0; k<checkBoxes.length; k++) {                var box = checkBoxes[k];                box.checked = true;              };          };      };  });  function singleLevelClicked(event) {      var allCheckbox = document.querySelector('[ng-model=mrl_all]');      allCheckbox.checked = false;      var clickedLevel = this.getAttribute('ng-model');      var levelTDs = document.querySelectorAll('[level-id=' + clickedLevel + ']');      var clickedOn = event.target.checked;      for (l=0; l<levelTDs.length; l++) {        var box = levelTDs[l];        changeDisplay(box, clickedOn);      };  };  function changeDisplay(element, on) {      if (!on) {          element.style.display = \"none\"      } else {          element.style.display = \"\"      };  }</script>";
dashboardTemplate="<div class='container-fluid'>  <div class=\"mra_panel\">    <div class=\"mra_page_title\">      <h2>Dashboard</h2>      <hr>    </div>    <div class='question' align='center'>  		{{mraOutputs.assessment.scope}}  </div>    <div align='center'>      <table id='dashboardtable' class='table table-responsive' style='max-width:85%; background: #f5f5f5;' align='center'>      <th align='center'>Thread</th><th>Sub Thread</th>        <th class=\"t-centered\">1</th>        <th class=\"t-centered\">2</th>        <th class=\"t-centered\">3</th>        <th class=\"t-centered\">4</th>        <th class=\"t-centered\">5</th>        <th class=\"t-centered\">6</th>        <th class=\"t-centered\">7</th>        <th class=\"t-centered\">8</th>        <th class=\"t-centered\">9</th>        <th class=\"t-centered\">10</th>        <th>Completion Date</th>      {{#each mraOutputs.threadStatus}}          <tr class=\"dash\"><td class=\"dash\">{{threadName}}</td><td class=\"dash\">{{subThreadName}}</td>            {{#each statuses}}              <td class=\"dash t-centered\" ng-show='{{this}}==0' style='background-color:#cfd8dc'></td>              <td class=\"dash t-centered\" ng-show='{{this}}==1' style='background-color:#77c577; font-size: 1.6em;'>&#x2713;</td>              <!-- <td class=\"dash\" ng-show='{{this}}==2' style='background-color:red'><span class='glyphicon glyphicon-remove'></span></td> -->              <td class=\"dash t-centered\" ng-show='{{this}}==2' style='background-color:#c57777; font-size: 1.8em;'>&#x2715;</td>              <td class=\"dash t-centered\" ng-show='{{this}}==3' style='background-color:#779dc5'>&#x2796;</td>            {{/each}}            <td class=\"dash\">{{date}}</td>            </tr>      {{/each}}      </table>    </div>    <br>    <br>    <div align='center'>      <a href onclick='$(\"#functionToCall\").val(\"getMmpPage\")' ng-click='run()'><button class=\"btn btn-primary buttonRounded\" style='margin:10px'>Action Items</button></a>      <a href onclick='$(\"#functionToCall\").val(\"getNotApplicablePage\")' ng-click='run()'><button class=\"btn btn-primary buttonRounded\" style='margin:10px'>Not Applicable Items</button></a>      <a href onclick='$(\"#functionToCall\").val(\"getSkippedPage\")' ng-click='run()'><button class=\"btn btn-primary buttonRounded\" style='margin:10px'>Skipped Items</button></a>      <a href id='saveAsImage'><button class=\"btn btn-primary\" style='margin:10px'>Save as image</button></a>    </div>    <input type='hidden' id='inputPage' value='dashboardPage'>  </div>  <div id=\"img-out\">  </div></div><script>  $( document ).ready(function() {    var saveButton = document.getElementById('saveAsImage');    saveButton.addEventListener('click', function() {      html2canvas($(\"#dashboardtable\"), {        onrendered: function(canvas) {          theCanvas = canvas;          canvas.id = 'dashCanvas';          canvas.style.display = 'none';          var imgDiv = document.querySelector('#img-out');          imgDiv.appendChild(canvas);          promptSaveFile(canvas);        }      });    });    function promptSaveFile(canvas) {      try {        window.navigator.msSaveBlob(canvas.msToBlob(), \"MRAdashboard.png\");      } catch(err) {        canvas.toBlob(function(blob) {          blobUrl = window.URL.createObjectURL(blob);          imgLink = createHiddenDownloadLink(blobUrl);          imgLink.click();        });      };    };    function createHiddenDownloadLink(blobUrl) {      var imgLink = document.createElement(\"a\");      imgLink.download = \"MRAdashboard.png\";      imgLink.href = blobUrl;      imgLink.style.display = 'none';      document.querySelector('#img-out').appendChild(imgLink);      return imgLink;    };  });</script>";
definitionTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Definitions</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    {{#if mraOutputs.assessment.targetLevel}}      <div class=\"col-sm-6 hidden-xs\">        <div class=\"row\">        <div class=\"col-xs-12 meta\">                  Target MRL: {{mraOutputs.assessment.targetLevel}} <span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}                </div>        </div>      </div>    {{/if}}  </div>  {{#if mraOutputs.assessment.targetLevel}}    <div class=\"collapse\"  id=\"subheader-collapseable\">    <div class=\"row visible-xs\">      <div class=\"col-xs-12\">          Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}      </div>    </div>    </div>  {{/if}}  </div></header><div class=\"container\" id=\"mainContent\">		<!-- TODO add search/jump in -->		<dl class=\"definitions\">      {{#each mraOutputs.definitions}}    		<dt>{{term}}</dt>    		<dd>{{definition}}</dd>      {{/each}}		</dl>	</div>";
footerTemplate="<div class='mra_footer'></div><script>  $( document ).ready(function() {    $('.dropdown-toggle').dropdown();    $('#docent-style')[0].innerText = decodeURI($('#docent-style')[0].innerText).replace(/&#x3D;/g,'=');  });</script></div>";
genericNavigationTemplate="<div id='blackLinks'>  <div class='container-fluid'>  <div class='mra_panel'>    <div class=\"mra_page_title\">      <h2>{{pageTitle}}</h2>      <hr>    </div>    <div class='row'>      <div class='col-lg-1'></div>      <div class='col-lg-10'>        <table class='table table-responsive table-hover' align='center'>          {{#each mraOutputs.navigation}}          <th colspan=3 align='center'>{{thread}}</th>            {{#each questions}}              <tr>                  <td align='left'></td>                  <td align='left'>Level:{{mrlLevel}}</td>                  <td align='left'>                    <a href onclick='$(\"#functionToCall\").val(\"getQuestionnairePageFromNavigation\");$(\"#navQuestionId\").val({{questionId}})' ng-click='run()'>{{questionText}}</a><br>                  </td>              </tr>            {{/each}}            </tr>          {{/each}}        </table>      </div>      <div class='col-lg-1'></div>    </div>  </div>  </div>    <input type='hidden' id='navThreadId' value='0'>    <input type='hidden' id='navSubThreadId' value='0'>    <input type='hidden' id='navSubThreadLevelId' value='0'>    <input type='hidden' id='navQuestionId' value='0'>    <input type='hidden' id='inputPage' value='navigationPage'></div>";
headerTemplate="<!-- <link rel='stylesheet' href='https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css' integrity='sha384-BVYiiSIFeK1dGmJRAkycuHAHRg32OmUcww7on3RYdg4Va+PmSTsz/K68vbdEjh4u' crossorigin='anonymous'> -->{{#if mraOutputs.isRunningInElectron}}  <style>  @font-face {    font-family: \"Didact Gothic\";    src: url(\"../fonts/didactgothic-regular-webfont.woff2\") format(\"woff2\"), url(\"../fonts/didactgothic-regular-webfont.woff\") format(\"woff\");    font-weight: normal;    font-style: normal  }  @font-face {    font-family: \"Poppins\";    src: url(\"../fonts/poppins-bold-webfont.woff2\") format(\"woff2\"), url(\"../fonts/poppins-bold-webfont.woff\") format(\"woff\");    font-weight: bold;    font-style: normal  }  </style>{{else}}  <link href=\"https://fonts.googleapis.com/css?family=Didact+Gothic|Poppins:700\" rel=\"stylesheet\">{{/if}}<style id=\"docent-style\"></style><!-- <script src=\"https://code.jquery.com/jquery-3.2.1.min.js\" integrity=\"sha256-hwg4gsxgFZhOsEEamdOYGBf13FyQuiTwlAQgxVSNgt4=\" crossorigin=\"anonymous\"></script> --><!-- <script src=\"https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/js/bootstrap.min.js\" integrity=\"sha384-Tc5IQib027qvyjSMfHjOMaLkfuWVxZxUPnCJA7l2mCWNIpG9mGCD8wGNIcPD7Txa\" crossorigin=\"anonymous\"></script> --><script src='https://cdnjs.cloudflare.com/ajax/libs/html2canvas/0.4.1/html2canvas.min.js' integrity='sha256-c3RzsUWg+y2XljunEQS0LqWdQ04X1D3j22fd/8JCAKw=' crossorigin='anonymous'></script><div id=\"docent\">  <div class=\"greyout\">	   <div class=\"loader absolute-center\"></div>  </div><header id=\"primaryheader\"><nav class=\"navbar navbar-default\">  <div class=\"container\">  <div class=\"topWrap\">    <!-- Brand and toggle get grouped for better mobile display -->    <div class=\"navbar-header\">      <button type=\"button\" class=\"navbar-toggle collapsed\" data-toggle=\"collapse\" data-target=\"#bs-example-navbar-collapse-1\" aria-expanded=\"false\">        <span class=\"sr-only\">Toggle navigation</span>      </button>     <a class=\"navbar-brand\" href=\"/\"><img src=\"data:image/svg+xml;base64,\" alt=\"docent\" ></a>    </div>    <!-- Collect the nav links, forms, and other content for toggling -->    <div class=\"collapse navbar-collapse\" id=\"bs-example-navbar-collapse-1\">      <ul class=\"nav navbar-nav navbar-right hidden-xs\">        <li class=\"dropdown hidden-xs\">          <a href=\"javascript:void(0)\" class=\"dropdown-toggle\" data-toggle=\"dropdown\" role=\"button\" aria-haspopup=\"true\" aria-expanded=\"false\" ng-show='\"{{mraOutputs.outputPage}}\"!=\"startPage\" || {{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onmouseover=\"if (typeof(updateActionPersonWithCurrent) == 'function') {updateActionPersonWithCurrent();}\">Menu <span class=\"caret\"></span></a>          <ul class=\"dropdown-menu\">            <li><a href onclick='$(\"#functionToCall\").val(\"getStartPage\")' ng-show='\"{{mraOutputs.outputPage}}\"!=\"startPage\"' ng-click='run()'>Start</a></li>            <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getNextQuestionnairePage\")' ng-show='\"{{mraOutputs.outputPage}}\"!=\"startPage\"' ng-click='run()'>Continue</a></li>            <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getDashboardPage\")' ng-click='run()'>Dashboard</a></li>            <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getNavigationPage\")' ng-click='run()'>Navigate</a></li>            <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getMmpPage\")' ng-click='run()'>Action Items</a></li>            <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getSkippedPage\")'>Skipped Questions</a></li>            <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getNotApplicablePage\")' ng-click='run()'>N/A Questions</a></li>            <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getReviewPage\")' ng-click='run()'>Review</a></li>            {{#if mraOutputs.isRunningInElectron}}<li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"saveAssessment\")' ng-click='run()'>Save</a></li>{{/if}}          </ul>        </li>        <li class=\"dropdown hidden-xs\">          <a href=\"javascript:void(0)\" class=\"dropdown-toggle\" data-toggle=\"dropdown\" role=\"button\" aria-haspopup=\"true\" aria-expanded=\"false\">Help <span class=\"caret\"></span></a>          <ul class=\"dropdown-menu\">            <li><a href onclick='$(\"#functionToCall\").val(\"getCriteriaPage\")' ng-click='run()'>Criteria</a></li>            <li><a href onclick='$(\"#functionToCall\").val(\"getDefinitionsPage\")' ng-click='run()'>Definitions</a></li>            <li><a href onclick='$(\"#functionToCall\").val(\"getAcronymsPage\")' ng-click='run()'>Acronyms</a></li>            <li><a href onclick='$(\"#functionToCall\").val(\"getHelpPage\")' ng-click='run()'>Help</a></li>          </ul>        </li>        </ul>        <ul class=\"nav navbar-nav visible-xs\">                        <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getDashboardPage\")' ng-click='run()'>Dashboard</a></li>                        <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getNavigationPage\")' ng-click='run()'>Navigate</a></li>                        <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getMmpPage\")' ng-click='run()'>Action Items</a></li>                        <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getSkippedPage\")'>Skipped Questions</a></li>                        <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getNotApplicablePage\")' ng-click='run()'>N/A Questions</a></li>                        <li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"getReviewPage\")' ng-click='run()'>Review</a></li>                        {{#if mraOutputs.isRunningInElectron}}<li><a href ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' onclick='$(\"#functionToCall\").val(\"saveAssessment\")' ng-click='run()'>Save</a></li>{{/if}}                        <li><a href onclick='$(\"#functionToCall\").val(\"getCriteriaPage\")' ng-click='run()'>Criteria</a></li>                        <li><a href onclick='$(\"#functionToCall\").val(\"getDefinitionsPage\")' ng-click='run()'>Definitions</a></li>                        <li><a href onclick='$(\"#functionToCall\").val(\"getAcronymsPage\")' ng-click='run()'>Acronyms</a></li>                        <li><a href onclick='$(\"#functionToCall\").val(\"getHelpPage\")' ng-click='run()'>Help</a></li>      </ul>    </div><!-- /.navbar-collapse -->  </div><!-- /.container-fluid -->  </div>  <input type='hidden' id='functionToCall' value='getStartPage'/>  <input type='hidden' id='dmcProjectId' value='\{{projectData.id}}' />  {{#if mraOutputs.outputPage}}    <span ng-if='\"{{mraOutputs.outputPage}}\"!=\"startPage\"'><input type='hidden' id='inAssessmentPath' value='{{mraOutputs.outAssessmentPath}}'/></span>  {{/if}}</nav><a href onclick='$(\"#functionToCall\").val(\"getCriteriaPage\")' ng-click='run()'>Criteria</a><a href onclick='$(\"#functionToCall\").val(\"getDefinitionsPage\")' ng-click='run()'>Definitions</a><a href onclick='$(\"#functionToCall\").val(\"getAcronymsPage\")' ng-click='run()'>Acronyms</a><a href onclick='$(\"#functionToCall\").val(\"getHelpPage\")' ng-click='run()'>Help</a></header>";
helpTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Help</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    {{#if mraOutputs.assessment.targetLevel}}      <div class=\"col-sm-6 hidden-xs\">        <div class=\"row\">        <div class=\"col-xs-12 meta\">                  Target MRL: {{mraOutputs.assessment.targetLevel}} <span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}                </div>        </div>      </div>    {{/if}}  </div>  {{#if mraOutputs.assessment.targetLevel}}    <div class=\"collapse\"  id=\"subheader-collapseable\">    <div class=\"row visible-xs\">      <div class=\"col-xs-12\">          Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}      </div>    </div>    </div>  {{/if}}  </div></header><div class=\"container\" id=\"mainContent\">  {{#each mraOutputs.helpMenuItems}}		<div class=\"faqQuestion\">		<div style=\"margin-bottom: 10px;\" class=\"collapse-link\" data-toggle=\"collapse\" data-target=\"#help{{@index}}\" aria-expanded=\"false\" aria-controls=\"help{{@index}}\">{{helpTitle}}</div>  		<dl class=\"collapse\" id=\"help{{@index}}\">        {{#each helpText}}          <dd>{{{this}}}</dd>        {{/each}}      </dl>		</div>  {{/each}}</div><input type='hidden' id='inputPage' value='helpPage'></div>";
importTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Saved Assessments</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    <div class=\"col-sm-6 hidden-xs\">    </div>  </div>  </div></header><div class=\"container\" id=\"mainContent\">    {{#if mraOutputs.assessmentNames}}      <h2>Assessments For This Workspace</h2>      <p class=\"instruction\">Select an assessment to open</p>		<div class=\"acronymTable row-striped\">    {{#each mraOutputs.assessmentNames}}  		<div><div class=\"row\">  			<div class=\"col-sm-9\"><a href onclick='$(\"#inAssessmentPath\").val(\"{{this}}\");$(\"#functionToCall\").val(\"getStartPage\")' ng-click='run()'>{{this}}</a></div>  			<div class=\"col-sm-3\"><a href onclick='$(\"#inAssessmentPath\").val(\"{{this}}\");$(\"#functionToCall\").val(\"deleteAssessment\")' ng-click='run()'>DELETE</a></div>  		</div>  		</div>    {{/each}}    </div>    {{else}}    <h2>No Assessments Found For This Project</h2>    <button style='display:inline;' type='button' class='btn btn-primary' style='margin-bottom:10px' onclick='$(\"#functionToCall\").val(\"getStartPage\")' ng-click='run()'>Start Assessment</button>    {{/if}}	</div>  <input type='hidden' id='inputPage' value='importPage'></div>";
mmpTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Action Items</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    <div class=\"col-sm-6 hidden-xs\">      <div class=\"row\">      <div class=\"col-xs-12 meta\">                Target MRL: {{mraOutputs.assessment.targetLevel}} <span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}              </div>      </div>    </div>  </div>  <div class=\"collapse\"  id=\"subheader-collapseable\">  <div class=\"row visible-xs\">    <div class=\"col-xs-12\">    Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}    </div>  </div>  </div>  </div></header><div class=\"container\" id=\"mainContent\">	<div class=\"row\">	<div class=\"col-xs-12\">	<div class=\"pull-right\"><a href=\"javascript:void(0)\" id=\"exportCSV\" class=\"btn-link\"><span class=\"glyphicon glyphicon-export\"></span> Export</a></div>	</div>	</div>  <div id=\"csvExportDiv\" class='col-md-3'>    <span style=\"display: none;\" id=\"actionPlanCSVString\">{{mraOutputs.answersCSV}}</span>    <!-- <button id=\"exportCSV\" class='btn btn-primary pull-right' style='margin:10px'>Export</button> -->  </div>{{#each mraOutputs.actionPlan}}	<div class=\"actionItem\">	<p><b>{{threadName}}</b> / {{subThreadName}} / {{mrlLevel}}</p>  <h5><a href onclick='$(\"#functionToCall\").val(\"getQuestionnairePageFromNavigation\");$(\"#navQuestionId\").val({{questionId}})' ng-click='run()'>{{questionText}}</a></h5>  <div class=\"row\">    <div class=\"col-xs-6\">    	<dl>        <dt>Reason:</dt>        <dd>{{reason}}</dd>        <dt>Action</dt>        <dd>{{whatAction}}</dd>        <dt>Assumptions: </dt>        <dd>{{assumptions}}</dd>        <dt>Notes</dt>        <dd>{{notes}}</dd>      </dl>    </div>    <div class=\"col-xs-6\">      <dl>        {{#if completionDate}}      		<dt>Completion Date:</dt>      		<dd>{{completionDate}}</dd>        {{/if}}    		<!-- <dt>Cost Risk: </dt>    		<dd>None</dd>    		<dt>Schedule Risk</dt>    		<dd>None</dd>    		<dt>Technical Risk</dt>    		<dd>none</dd> -->        <dt>Risks:</dt>        <dd ng-show='\"{{costRisk}}\"==\"1\"'>Cost Risk</dd>        <dd ng-show='\"{{scheduleRisk}}\"==\"1\"'>Schedule Risk</dd>        <dd ng-show='\"{{technicalRisk}}\"==\"1\"'>Technical Risk</dd>    		<dt>Team Members</dt>        {{#each actionPerson}}          <dd style='list-style-type:none'>{{name}}</dd>        {{/each}}    		<dt>Attachements</dt>        {{#each attachments}}    		  <dd><a href=\"javascript:void(0)\" onclick='$(\"#functionToCall\").val(\"downloadAttachment\");$(\"#attachmentId\").val(\"{{id}}\")' ng-click='run()'>Operaiton-inspection-Q2_2017.pdf</a></dd>        {{/each}}    	</dl>    </div>  </div>	</div>{{/each}}</div><input type='hidden' id='inputPage' value='mmpPage'><input type='hidden' id='navQuestionId' value='0'><input type='hidden' id='attachmentId' value=''/><script>  $( document ).ready(function() {    var exportButton = document.getElementById('exportCSV');    exportButton.addEventListener('click', function() {      downloadCSV();    });  });  function downloadCSV() {    var csv = generateCSVString();    var hiddenElement = document.createElement('a');    hiddenElement.href = 'data:text/csv;charset=utf-8,' + encodeURI(csv);    hiddenElement.target = '_blank';    hiddenElement.download = 'MRA_action_items.csv';    hiddenElement.style.display = 'none';    document.querySelector('#csvExportDiv').appendChild(hiddenElement);    hiddenElement.click();  }  function generateCSVString() {    var csv = (document.getElementById('actionPlanCSVString')).textContent;    csv = JSON.parse(csv);    for (var i=0; i < csv.length; i++) {      csv[i] = csv[i].join(',');    }    csv = csv.join(\"\");    return csv;  }</script>";
navigationTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Navigation</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    {{#if mraOutputs.assessment.targetLevel}}      <div class=\"col-sm-6 hidden-xs\">        <div class=\"row\">        <div class=\"col-xs-12 meta\">                  Target MRL: {{mraOutputs.assessment.targetLevel}} <span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}                </div>        </div>      </div>    {{/if}}  </div>  {{#if mraOutputs.assessment.targetLevel}}    <div class=\"collapse\"  id=\"subheader-collapseable\">    <div class=\"row visible-xs\">      <div class=\"col-xs-12\">          Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}      </div>    </div>    </div>  {{/if}}  </div></header><div class=\"container\" id=\"mainContent\">		<!-- <div class=\"row\">		<div class=\"col-sm-6\">			<a class=\"document-link\" href=\"#\"><span class=\"glyphicon glyphicon-file\"></span> MRL Desktop V2.4</a>		</div>		<div class=\"col-sm-6 milestoneCol\">			<span class=\"dl-label\">Milestones</span>			<dl class=\"milestoneList\">				<dt>A</dt>				<dd>MRL 5</dd>				<dt>B</dt>				<dd>MRL 7</dd>				<dt>C</dt>				<dd>MRL 9</dd>			</dl>		</div>		</div> -->	<div class=\"criteria-filter-head\">		<div class=\"filter-top\">		<div class=\"row\">			<div class=\"col-xs-12\">				<button class=\"criteria-controls filter-button collapsed\" data-toggle=\"collapse\" data-target=\"#collapseFilter\">Filter</button>					<!-- <div class=\"expand-controls pull-right\">			<a href=\"javascript:void(0)\" class=\"criteria-controls expand-all\"><span class=\"glyphicon glyphicon-collapse-down\"></span> Expand all</a>			<a href=\"javascript:void(0)\" class=\"criteria-controls collapse-all\"><span class=\"glyphicon glyphicon-collapse-up\"></span> Collapse all</a>			</div> -->			</div>		</div>		</div>		<div class=\"criteria-filter-container collapse\" id=\"collapseFilter\">		<!-- <div class=\"filter-block\">		<div class=\"row\">			<div class=\"col-xs-12\">			<div class=\"filter-label\">Filter by Thread</div>			</div>		</div>		<div class=\"row\">			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Technology Maturity				    </label>				  </div>				  <div class=\"checkbox\">				      <label>				        <input type=\"checkbox\"> Technology &amp; Industrial Base				      </label>				    </div>				    <div class=\"checkbox\">				        <label>				          <input type=\"checkbox\"> Design				        </label>				      </div>			</div>			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Technology Maturity				    </label>				  </div>				  <div class=\"checkbox\">				      <label>				        <input type=\"checkbox\"> Technology &amp; Industrial Base				      </label>				    </div>				    <div class=\"checkbox\">				        <label>				          <input type=\"checkbox\"> Design				        </label>				      </div>			</div>			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Technology Maturity				    </label>				  </div>				  <div class=\"checkbox\">				      <label>				        <input type=\"checkbox\"> Technology &amp; Industrial Base				      </label>				    </div>				    <div class=\"checkbox\">				        <label>				          <input type=\"checkbox\"> Design				        </label>				      </div>			</div>			<div class=\"col-sm-3\">				<div class=\"checkbox\">				    <label>				      <input type=\"checkbox\"> Manufacturing Management				    </label>				  </div>				 </div>			</div>		</div> -->		<div class=\"filter-block form-inline\">		<div class=\"row \">		<div class=\"col-xs-12\">		<div class=\"filter-label\">Filter by MRL</div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-init='mrl_all=true' ng-model='mrl_all'>All</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_1'>1</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_2'>2</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_3'>3</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_4'>4</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_5'>5</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_6'>6</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_7'>7</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_8'>8</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_9'>9</label>      </div>      <div class=\"checkbox\">        <label><input type=\"checkbox\" ng-checked='mrl_all' ng-model='mrl_10'>10</label>      </div>		</div>		</div>		</div>		</div>	</div>	<div class=\"criteria-list\">      {{#each mraOutputs.navigation}}		 <div class=\"navigation-group\">			      <h4 class=\"group-title\">			        <button role=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThread{{@index}}\" aria-expanded=\"true\" aria-controls=\"collapseThread{{@index}}\" class=\"collapse-item collapsed\">			          {{name}}			        </button>			      </h4>			    <ul id=\"collapseThread{{@index}}\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne\">            {{#each subThreads}}			     <li>			     	<button role=\"button\" data-toggle=\"collapse\" data-target=\"#collapseSubThread_{{@../index}}_{{@index}}\" aria-expanded=\"true\" aria-controls=\"collapseSubThread_{{@../index}}_{{@index}}\" class=\"collapse-item collapsed\">			     	  {{name}}			     	</button>			     	<dl id=\"collapseSubThread_{{@../index}}_{{@index}}\" class=\"collapse\">              {{#each subThreadLevels}}    							<dt level-id=\"mrl_{{mrlLevel}}\">MRL {{mrlLevel}}</dt>                  {{#each questions}}                    <dd level-id=\"mrl_{{../mrlLevel}}\"><a href onclick='$(\"#functionToCall\").val(\"getQuestionnairePageFromNavigation\");$(\"#navQuestionId\").val({{questionId}})' ng-click='run()'>{{questionText}}</a></dd>                  {{/each}}              {{/each}}			     	</dl>				     	</li>            {{/each}}			    </ul>			 </div>       {{/each}}	</div>  <input type='hidden' id='navThreadId' value='0'>  <input type='hidden' id='navSubThreadId' value='0'>  <input type='hidden' id='navSubThreadLevelId' value='0'>  <input type='hidden' id='navQuestionId' value='0'>  <input type='hidden' id='inputPage' value='navigationPage'><script type=\"text/javascript\">  $(document).ready(function() {      var checkBoxes = document.querySelectorAll('input[ng-model*=mrl_]');      var tds = document.querySelectorAll('[level-id*=mrl_]');      for (var i=0; i<checkBoxes.length; i++) {        var checkBox = checkBoxes[i];        var ngModel = checkBox.getAttribute('ng-model');        if (ngModel == 'mrl_all') {            checkBox.addEventListener(\"click\", allClicked);        } else {            checkBox.addEventListener(\"click\", singleLevelClicked);        };      };      function allClicked(event) {          if (!event.target.checked) {              for (var j=0; j<tds.length; j++) {                var td = tds[j];                td.style.display = \"none\";              };          } else {              for (var j=0; j<tds.length; j++) {                var td = tds[j];                td.style.display = \"\";                td.checked = true;              };              for (var k=0; k<checkBoxes.length; k++) {                var box = checkBoxes[k];                box.checked = true;              };          };      };  });  function singleLevelClicked(event) {      var allCheckbox = document.querySelector('[ng-model=mrl_all]');      allCheckbox.checked = false;      var clickedLevel = this.getAttribute('ng-model');      var levelTDs = document.querySelectorAll('[level-id=' + clickedLevel + ']');      var clickedOn = event.target.checked;      for (l=0; l<levelTDs.length; l++) {        var box = levelTDs[l];        changeDisplay(box, clickedOn);      };  };  function changeDisplay(element, on) {      if (!on) {          element.style.display = \"none\"      } else {          element.style.display = \"\"      };  }</script>";
questionnaireTemplate="<header id=\"subheader\" class=\"has-progress\">		<div class=\"container\">		<div class=\"row\">			<div class=\"col-sm-6\">			<ol class=\"breadcrumb\">			  <li><a href=\"javascript:void(0)\" href onclick='$(\"#functionToCall\").val(\"getNavigationPage\")' ng-click='run()'>{{mraOutputs.question.threadName}}</a></li>			  <li class=\"active\">{{mraOutputs.question.subThreadName}}</li>			</ol>			<span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>			</div>			<div class=\"col-sm-6 hidden-xs\">				<div class=\"row\">				<div class=\"col-xs-12 meta\">					Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}				</div>				</div>				<div class=\"row\">				<div class=\"col-xs-12 meta\">					<span class=\"collapse-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\">Show Assessment Scope</span>				</div>				</div>			</div>		</div>		<div class=\"collapse\"  id=\"subheader-collapseable\">		<div class=\"row visible-xs\">			<div class=\"col-xs-12\">			Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}			</div>		</div>		<div class=\"row\">			<div class=\"col-xs-12\">			<p>{{mraOutputs.assessment.scope}}</p>			</div>		</div>		</div>		</div>	</header><div class=\"container\" id=\"mainContent\">    <div class=\"row\">        <div class=\"col-md-8\">            <div class=\"question-header\">                <h4>MRL: 6</h4>                <h1>{{{mraOutputs.question.questionText}}}</h1>                <span class=\"collapse-link\" data-toggle=\"collapse\" data-target=\"#question-explanation\" aria-expanded=\"false\" aria-controls=\"question-explanation\">Show Explanation</span>                <p class=\"collapse\" id=\"question-explanation\">{{{mraOutputs.question.helpText}}}</p>            </div>            <form>                <div class=\"form-group\">                    <label for=\"answerValue\">Answer</label>                    <select class=\"form-control\" id=\"answerValue\" ng-model='selectOption' ng-init='selectOption={{#if mraOutputs.answerInfo.answer}}\"{{mraOutputs.answerInfo.answer}}\"{{else}}\"0\"{{/if}}'>                      <option value='0'>Select...</option>                      <option value='1'>Yes</option>                      <option value='2'>No</option>                      <option value='3'>Not Applicable</option>					          </select>                </div>                <div ng-switch='selectOption'>                    <div class=\"form-group\" ng-switch-when='1'>                        <label for=\"evidence\">Objective Evidence</label>                        <textarea class=\"form-control\" id=\"evidence\" rows=\"5\" placeholder='Enter objective evidence here...'>{{#if mraOutputs.answerInfo.evidence}}{{mraOutputs.answerInfo.evidence}}{{/if}}</textarea>                    </div>                    <div class=\"mrl_actionPersons\" ng-switch-when='2' ng-init='mrl_actionPersonArray=[\"0\"];mrl_numActionPerson=1'>                        <h3 class=\"section-heading\">Action Plan</h3>                        <div class=\"row\">                          <div class=\"col-md-4\">                            <button class=\"addButton\" ng-click='mrl_actionPersonArray.push(mrl_numActionPerson);mrl_numActionPerson=mrl_numActionPerson+1'><span class=\"glyphicon glyphicon-plus-sign\"></span>Add Action Person</button>                          </div>                          <div class=\"col-md-4\">                            <button class=\"removeButton\" ng-click='mrl_actionPersonArray.splice(-1);mrl_numActionPerson=mrl_numActionPerson-1'><span class=\"glyphicon glyphicon-minus-sign\"></span>Remove</button>                          </div>                        </div>                        <div class=\"row\">                          <div class=\"col-md-8\">                              <div class=\"form-group\">                                  <label>Who</label>                                  <!-- Loop for existing team members -->                                  {{#each mraOutputs.answerInfo.actionPerson}}                                    <input style=\"margin-bottom: 5px;\" type=\"text\" class=\"form-control mrl_actionPersonName\" name=\"member[]\" value='{{this}}'/>                                  {{/each}}                                  <!-- Loop for newly added team members -->                                  <div ng-repeat='x in mrl_actionPersonArray'>                                    <input style=\"margin-bottom: 5px;\" type=\"text\" class=\"form-control mrl_actionPersonName\" name=\"member[]\"/>                                  </div>                              </div>                          </div>                          <div class=\"col-md-4\">                              <label for=\"answer-evidence\">When</label>                              <div class=\"form-group\">                                  <input type=\"date\" class=\"form-control\" id='completionDate' {{#if mraOutputs.answerInfo.completionDate}} value=\"{{mraOutputs.answerInfo.completionDate}}\" {{/if}}>                              </div>                          </div>                        </div>                        <div class=\"row\">                            <div class=\"col-xs-12\">                                <label for=\"answer-evidence\">Risk</label>                                <div class=\"form-group\">                                    <div class=\"checkbox-inline  \">                                        <label>                    					  	      <input type=\"checkbox\" id='technicalRisk' onclick='$(this).attr(\"value\", this.checked ? 1 : 0)' {{#if mraOutputs.answerInfo.technicalRisk}}checked{{/if}} {{#if mraOutputs.answerInfo.technicalRisk}}value='1'{{else}}value='0'{{/if}}> Technical                    					  	    </label>                                    </div>                                    <div class=\"checkbox-inline\">                                        <label>                    					  	        <input type=\"checkbox\" id='costRisk' onclick='$(this).attr(\"value\", this.checked ? 1 : 0)' {{#if mraOutputs.answerInfo.costRisk}}checked{{/if}} {{#if mraOutputs.answerInfo.costRisk}}value='1'{{else}}value='0'{{/if}}> Cost                    					  	      </label>                                    </div>                                    <div class=\"checkbox-inline\">                                        <label>                    					  	          <input type=\"checkbox\" id='scheduleRisk' onclick='$(this).attr(\"value\", this.checked ? 1 : 0)' {{#if mraOutputs.answerInfo.scheduleRisk}}checked{{/if}} {{#if mraOutputs.answerInfo.scheduleRisk}}value='1'{{else}}value='0'{{/if}}> Schedule                    					  	        </label>                                    </div>                                </div>                            </div>                        </div>                        <div class=\"form-group\">                            <label for=\"answer-evidence\">What</label>                            <textarea class=\"form-control\" rows=\"5\" id='whatAction' placeholder='What needs to be done to meet this objective?'>{{#if mraOutputs.answerInfo.whatAction}}{{mraOutputs.answerInfo.whatAction}}{{/if}}</textarea>                        </div>                        <div class=\"form-group\">                            <label for=\"answer-evidence\">Reason</label>                            <textarea class=\"form-control\" rows=\"5\" id='reason' placeholder='Reason that criteria is not met'>{{#if mraOutputs.answerInfo.reason}}{{mraOutputs.answerInfo.reason}}{{/if}}</textarea>                        </div>                    </div>                    <div ng-switch-when='3'>                        <label for=\"evidence\">Documentation</label>                        <textarea class=\"form-control\" id=\"documentation\" rows=\"5\" placeholder='Document why this question is not applicable...'>{{#if mraOutputs.answerInfo.documentation}}{{mraOutputs.answerInfo.documentation}}{{/if}}</textarea>                    </div>                    <hr/>                    <!-- Always have these two -->                    <div class=\"form-group\">                        <label for=\"assumptions\">Assumptions</label>                        <textarea class=\"form-control\" rows=\"5\" placeholder=\"Enter any assumptions here...\" id='assumptions' placeholder='Enter any assumptions here...'>{{#if mraOutputs.answerInfo.assumptions}}{{mraOutputs.answerInfo.assumptions}}{{/if}}</textarea>                    </div>                    <div class=\"form-group\">                        <label for=\"notes\">Notes</label>                        <textarea class=\"form-control\" id=\"notes\" rows=\"5\" placeholder='Enter notes here...'>{{#if mraOutputs.answerInfo.notes}}{{mraOutputs.answerInfo.notes}}{{/if}}</textarea>                    </div>                </div>            </form>            <div class=\"attachments\">              <dl class=\"attachments-list\">                {{#if mraOutputs.answerInfo.attachments}}                  <dt>Attachments</dt>                {{/if}}                {{#each mraOutputs.answerInfo.attachments}}                    <dd><a href=\"javascript:void(0)\" onclick='$(\"#functionToCall\").val(\"downloadAttachment\");$(\"#attachmentId\").val(\"{{id}}\")' ng-click='run()'>{{attachmentName}}</a><span class=\"attachment-remove\" onclick='$(\"#functionToCall\").val(\"deleteAttachment\");$(\"#attachmentId\").val(\"{{id}}\")'                            ng-click='run()'></span></dd>                {{/each}}              </dl>              {{#if mraOutputs.isRunningInElectron}}                <span class=\"btn btn-default\" onclick='$(\"#functionToCall\").val(\"addAttachment\")' ng-click='run()'>Attach File</span>              {{/if}}            </div>        </div>        <div class=\"col-md-3 col-md-offset-1\">            <div class=\"navigation-controls\">                <div class=\"btn btn-primary\"> <span class=\"glyphicon glyphicon-triangle-left\"></span>Previous</div>                <div class=\"btn btn-primary\" ng-show='!(selectOption==1 || selectOption==2 || selectOption==3)' onclick='$(\"#functionToCall\").val(\"getNextQuestionnairePage\")' ng-click='run()'>Skip<span class=\"glyphicon glyphicon-triangle-right\"></div>                <div class=\"btn btn-primary\" ng-show='(selectOption==1 || selectOption==2 || selectOption==3)' onclick='$(\"#functionToCall\").val(\"getNextQuestionnairePage\")' ng-click='run()'>Next<span class=\"glyphicon glyphicon-triangle-right\"></div></span>            </div>        </div>        <input type='hidden' id='actionPerson' value='{{mraOutputs.answerInfo.actionPersonFormatted}}' />        <input type='hidden' id='attachmentId' value=''/>        <input type='hidden' id='questionId' value='{{mraOutputs.question.questionId}}'>        <input type='hidden' id='inputPage' value='questionnairePage'>  <script type=\"text/javascript\">      function updateActionPersonWithCurrent() {          var actionPersonList = $(\".mrl_actionPersonName\").map(function(x) {              return $(\".mrl_actionPersonName\")[x].value;          }).get();          actionPersonList = JSON.stringify(actionPersonList);          $(\"#actionPerson\").val(actionPersonList);      }      $(document).ready(function() {          document.onkeyup = function() {            updateActionPersonWithCurrent();          };          document.onclick = function() {            updateActionPersonWithCurrent();          };          updateActionPersonWithCurrent();      });  </script>";
reviewTemplate="<header id=\"subheader\">  <div class=\"container\">  <div class=\"row\">    <div class=\"col-sm-6\">    <ol class=\"breadcrumb\">      <li class=\"active\">Review</li>    </ol>    <span class=\"collapse-link visible-xs xs-expand-link\" data-toggle=\"collapse\" data-target=\"#subheader-collapseable\" aria-expanded=\"false\" aria-controls=\"subheader-collapseable\"><span class=\"glyphicon glyphicon-triangle-bottom\"></span></span>    </div>    <div class=\"col-sm-6 hidden-xs\">      <div class=\"row\">      <div class=\"col-xs-12 meta\">                Target MRL: {{mraOutputs.assessment.targetLevel}} <span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}              </div>      </div>    </div>  </div>  <div class=\"collapse\"  id=\"subheader-collapseable\">  <div class=\"row visible-xs\">    <div class=\"col-xs-12\">    Target MRL: {{mraOutputs.assessment.targetLevel}}<span class=\"text-divider\">|</span>Target Date: {{mraOutputs.assessment.targetDate}}    </div>  </div>  </div>  </div></header><div class=\"container\" id=\"mainContent\">	<a class=\"export\" href=\"#\"><span class=\"glyphicon glyphicon-export\"></span>Export</a>		<p>{{assessment.scope}}</p>	<dl class=\"inline-list\">	<dt>Target MRL:</dt><dd>{{mraOutputs.assessment.targetLevel}}</dd>	<dt>Target Date:</dt> <dd>{{mraOutputs.assessment.targetDate}}</dd>	<dt>Location: </dt><dd>{{mraOutputs.assessment.location}}</dd>	<dt>Team Members</dt>    {{#each mraOutputs.assessment.teamMembers}}      <dd>{{name}} - {{role}}</dd>    {{/each}}	</dl>  {{#each mraOutputs.reviewInfo}}  <!-- SKIPPED -->	<div class=\"review-block\" ng-if='{{answer}}==0'>    <h2><a href onclick='$(\"#functionToCall\").val(\"getQuestionnairePageFromNavigation\");$(\"#navQuestionId\").val({{questionId}})' ng-click='run()'>{{questionText}}</a></h2>		<div class=\"status-skipped\">Skipped</div>		<dl>			<dt>Assumptions:</dt>			<dd>{{assumptions}}</dd>			<dt>Notes:</dt><dd>{{notes}}</dd>			<dt>Attachements:</dt>      {{#each attachments}}        <dd><a href=\"javascript:void(0)\" onclick='$(\"#functionToCall\").val(\"downloadAttachment\");$(\"#attachmentId\").val(\"{{id}}\")' ng-click='run()'>Operaiton-inspection-Q2_2017.pdf</a></dd>      {{/each}}	</div>  <!-- NO -->	<div class=\"review-block\" ng-if='{{answer}}==2'>    <h2><a href onclick='$(\"#functionToCall\").val(\"getQuestionnairePageFromNavigation\");$(\"#navQuestionId\").val({{questionId}})' ng-click='run()'>{{questionText}}</a></h2>		<div class=\"status-no\">No</div>	</div>  <!-- YES -->	<div class=\"review-block\" ng-if='{{answer}}==1'>    <h2><a href onclick='$(\"#functionToCall\").val(\"getQuestionnairePageFromNavigation\");$(\"#navQuestionId\").val({{questionId}})' ng-click='run()'>{{questionText}}</a></h2>		<div class=\"status-yes\">Yes</div>		<dl>			<dt>Object Evidence:</dt>			<dd>{{evidence}}</dd>		</dl>	</div>  <!--N/A  -->	<div class=\"review-block\" ng-if='{{answer}}==3'>    <h2><a href onclick='$(\"#functionToCall\").val(\"getQuestionnairePageFromNavigation\");$(\"#navQuestionId\").val({{questionId}})' ng-click='run()'>{{questionText}}</a></h2>		<div class=\"status-na\">Not Applicable</div>	</div>  {{/each}}  <input type='hidden' id='navQuestionId' value='0'>  <input type='hidden' id='inputPage' value='reviewPage'>  <input type='hidden' id='attachmentId' value=''/></div><script>  $( document ).ready(function() {    var exportButton = document.getElementById('exportCSV');    exportButton.addEventListener('click', function() {      downloadCSV();    });  });  function downloadCSV() {    var csv = generateCSVString();    var hiddenElement = document.createElement('a');    hiddenElement.href = 'data:text/csv;charset=utf-8,' + encodeURI(csv);    hiddenElement.target = '_blank';    hiddenElement.download = 'MRA_review.csv';    hiddenElement.style.display = 'none';    document.querySelector('#csvExportDiv').appendChild(hiddenElement);    hiddenElement.click();  }  function generateCSVString() {    var csv = (document.getElementById('reviewCSVString')).textContent;    csv = JSON.parse(csv);    for (var i=0; i < csv.length; i++) {      csv[i] = csv[i].join(',');    }    csv = csv.join('');    return csv;  }</script>";
startTemplate="<div class=\"container\" id=\"mainContent\">    <h2> Start New Assessment</h2>    <p class=\"instruction\">Use this option to start a new assessment.</p>    <form>        <label>Team Members</label>        {{#unless mraOutputs.assessment.teamMembers}}        <div class=\"memberSection\" ng-init='mrl_teamMemberArray=[\"0\"];mrl_numTeamMembers=1'>        {{/unless}}        {{#if mraOutputs.assessment.teamMembers}}        <div class=\"memberSection\" ng-init='mrl_teamMemberArray=[];mrl_numTeamMembers=0'>        {{/if}}          {{#each mraOutputs.assessment.teamMembers}}            <div class=\"row memberRow\">                <div class=\"col-sm-6\">                    <input type=\"text\" class=\"form-control\" id='mrl_teamMemberName{{@index}}' value='{{name}}'/>                </div>                <div class=\"col-sm-5\">                    <input type=\"text\" class=\"form-control\" id='mrl_teamMemberRole{{@index}}' value='{{role}}'/>                </div>                <!-- <div class=\"col-sm-2\">                    <button class=\"removeButton\"><span class=\"glyphicon glyphicon-minus-sign\"></span></button>                </div> -->            </div>          {{/each}}            <div class=\"row memberRow\" ng-repeat='x in mrl_teamMemberArray'>                <div class=\"col-sm-6\">                    <input type=\"text\" class=\"form-control\" id='mrl_teamMemberName' placeholder=\"Member Name\" />                </div>                <div class=\"col-sm-5\">                    <input type=\"text\" class=\"form-control\" id='mrl_teamMemberRole' placeholder=\"Member Role\" />                </div>                <div class=\"col-sm-1\">                    <button style=\"vertical-align: text-top;\" class=\"removeButton\" ng-show='$last && mrl_teamMemberArray.length > 1' ng-click='mrl_teamMemberArray.splice(-1);mrl_numTeamMembers=mrl_numTeamMembers-1'><span class=\"glyphicon glyphicon-minus-sign\"></span></button>                </div>            </div>            <button class=\"addButton\" ng-click='mrl_teamMemberArray.push(mrl_numTeamMembers);mrl_numTeamMembers=mrl_numTeamMembers+1'><span class=\"glyphicon glyphicon-plus-sign\"></span>Add Team Member</button>        </div>        <div class=\"row\">            <div class=\"col-sm-6\">                <div class=\"form-group\">                    <label>Scope</label>                    <textarea id='scope' autofocus=\"\"class=\"form-control\" placeholder=\"Enter Scope Here\" rows=6 style=\"height:139px;\">{{mraOutputs.assessment.scope}}</textarea>                </div>                <div class=\"form-group\">                    <label>Location</label>                    <input type=\"text\" class=\"form-control\" placeholder=\"Enter Location\" id='location' value='{{mraOutputs.assessment.location}}'/>                </div>              {{#unless mraOutputs.isRunningInElectron}}                <div class='form-group'>                  <label>Name of Assessment:</label>                  <span ng-show='assessmentNameRequired'>{{assessmentNameRequired}}</span>                  <input type='text' class='form-control' id='inAssessmentPath' value='{{mraOutputs.outAssessmentPath}}' {{#if mraOutputs.outAssessmentPath}}readonly{{/if}}></input>                </div>              {{/unless}}            </div>            <div class=\"col-sm-6\">                <div class=\"form-group\">                    <label>Target MRL</label>                    <select class=\"form-control\" id='targetLevel' ng-init='init_level=\"{{mraOutputs.assessment.targetLevel}}\"' ng-model='init_level'>                      <option value=1>1</option>                      <option value=2>2</option>                      <option value=3>3</option>                      <option value=4>4</option>                      <option value=5>5</option>                      <option value=6>6</option>                      <option value=7>7</option>                      <option value=8>8</option>                      <option value=9>9</option>                      <option value=10>10</option>                		</select>                </div>                <div class=\"form-group\">                    <label>Date to Achieve Target MRL</label>                    <input type=\"date\" class=\"form-control\" id='targetDate' value='{{mraOutputs.assessment.targetDate}}'>                </div>                <div class=\"form-group\">                    <label>Deskbook Version</label>                    <select class='form-control' id='version'>                        <option title='v2016' value='1' selected='selected'>2016</option>                    </select>                </div>            </div>        </div>        <div class=\"row\">          <div id=\"startButtonWrapper\">            <button id=\"startButton\" class=\"btn btn-primary pull-right\" onclick='$(\"#functionToCall\").val(\"saveStartGetQuestionnairePage\")' ng-show='{{#if mraOutputs.outAssessmentPath}}false{{else}}true{{/if}}' ng-click='run()'>Start</button>            <button id=\"startButton\" class=\"btn btn-primary pull-right\" onclick='$(\"#functionToCall\").val(\"getNextQuestionnairePage\")' ng-show='{{#if mraOutputs.outAssessmentPath}}true{{else}}false{{/if}}' ng-click='run()'>Continue</button>          </div>        </div>        <div class=\"continueSection\">            <div class=\"row\">                <div class=\"col-sm-12\">                    <h2>Continue Existing Assessment</h2>                </div>            </div>            <div class=\"row\">                <div class=\"col-sm-6\">                    <p>Use this option to start working on an existing assessment. You will be required to import your assessment data.</p>                </div>                <div class=\"col-sm-6\">                    <button class=\"btn btn-primary\" onclick='$(\"#functionToCall\").val(\"getHelpPage\")' ng-click='run()' >Help Importing</button>                    <button class=\"btn btn-primary\" onclick='$(\"#functionToCall\").val(\"startPageImportAssessment\")' ng-click='run()'>{{#if mraOutputs.isRunningInElectron}}Open Assessment{{else}}View Assessments{{/if}}</button>                </div>            </div>        </div>    </form>    <input type='hidden' id='inputPage' value='startPage'/>    <input type='hidden' id='teamMemberNames' value=''/>    <input type='hidden' id='teamMemberRoles' value=''/></div><script>  $(document).ready(function() {    var startButton = document.getElementById('startButton');    var startButtonWrapper = document.getElementById('startButtonWrapper');    startButton.disabled = true;    var formFields = getFormFieldsToValidate();    var highlightPerformed = false;    document.onkeyup = function() {      if (highlightPerformed) { highlightMissingFields(formFields) };      enableStartButtonIfValid(startButton, formFields);      updateTeamMembers();    };    document.onclick = function() {      if (highlightPerformed) { highlightMissingFields(formFields) };      enableStartButtonIfValid(startButton, formFields);      updateTeamMembers();    };    startButtonWrapper.onmouseover = function(){      if (startButton.disabled) {        highlightPerformed = true;        highlightMissingFields(formFields);      }    };    updateTeamMembers();  });  function getFormFieldsToValidate() {    var targetDateField = document.getElementById('targetDate');    var targetLevelField = document.getElementById('targetLevel');    var deskbookVersionField = document.getElementById('version');    return [targetDateField, targetLevelField, deskbookVersionField];  }  function enableStartButtonIfValid(button, formFields) {    button.disabled = !validateFields(formFields);  };  function validateFields(formFields) {    var validationResult = returnInvalidIDs(formFields);    return validationResult.length == 0;  };  function returnInvalidIDs(formFields) {    var validationResult = [];    for (var i=0; i < formFields.length; i++){      var field = formFields[i];      if (field.id == 'targetLevel' || field.id == 'version'){        if (isNaN(field.value)){          validationResult.push(field);        }      }      if (field.id == 'targetDate'){        if (isNaN(Date.parse(field.value))){          validationResult.push(field);        }      }    }      return validationResult;  };  function highlightMissingFields(formFields) {    var invalidFields = returnInvalidIDs(formFields);    for (var i=0; i < formFields.length; i++) {      formFields[i].style.background = 'initial';    }    for (var j=0; j < invalidFields.length; j++) {      invalidFields[j].style.background = 'pink';    }  };  function updateTeamMembers() {    var memberNames = $(\"[id^=mrl_teamMemberName]\");    var memberRoles = $(\"[id^=mrl_teamMemberRole]\");    memberNames = memberNames.map(function(){      return $(this).val();    }).get();    memberRoles = memberRoles.map(function(){      return $(this).val();    }).get();    $(\"#teamMemberNames\").val(JSON.stringify(memberNames));    $(\"#teamMemberRoles\").val(JSON.stringify(memberRoles));  };</script>";
mraCss=".testClass {  }";
helpItems=[ { helpType: "dmc", helpTitle: 'Where do I start?', helpText: ["To start a new assessment, go to the Start page by selecting the 'Start' option from the 'Assessment' menu. Then fill out the data fields and click 'Start'. The name provided under 'Name of Assessment' will be used to save your assessment to the DMC's cloud storage."] }, { helpType: "standalone", helpTitle: 'Where do I start?', helpText: ["To start a new assessment, go to the Start page by selecting the 'Start' option from the 'Assessment' menu. Then fill out the data fields and click 'Start'. You will be prompted to choose a location to save your assessment."] }, { helpType: "standalone", helpTitle: 'How do I import an assessment?', helpText: ["If you already have an assessment you've saved, you can reopen it by selecting the 'Start' option from the 'Assessment' menu, then choosing 'Import Assessment' on the right side of the screen. Once you've chosen your import file, you should see the specific details of that assessment populate in the fields on the left."] }, { helpType: "dmc", helpTitle: 'How do I import an assessment?', helpText: ["If you already have an assessment you've created in the DMC, you can reopen it by selecting the 'Start' option from the 'Assessment' menu, then choosing 'Import Assessment' on the right side of the screen. This will present all of the assessments created in the workspace you are running Docent from. Once you've chosen your import file, you should see the specific details of that assessment populate in the fields on the left."] }, { helpTitle: 'How do I return to a previous question?', helpText: ["If you want to return to a previous question, you can use the 'back' button at the top left of the question page. This will back track through questions you've previously answered.", "Alternatively, you can also choose 'Review' option from the 'Assessment' menu. Here, you'll see a summary of all questions you've answered and you can return to any of them by clicking on it's title."] }, { helpType: "standalone", helpTitle: 'Where is my assessment saved?', helpText: ["All the data associated with your assessment is stored in a database file ending in '.mra'. The name of this file is specified when you initially create the assessment. In addition, any attachments you include with your assessment will be stored in this file."] }, { helpType: "dmc", helpTitle: 'Where is my assessment saved?', helpText: ["All the data associated with your assessment is kept in a database file which is stored in the cloud. The specific location of your assessment is dictated by the workspace you are running Docent from; only the assessments created in a given workspace will be available from that workspace."] }, { helpType: "standalone", helpTitle: 'How can I share an assessment with others?', helpText: ["<b>Sharing and Editing:</b> If you want to allow others to open and edit your assessment in this application, you can simply provide them the data file (ending in '.mra') that you created. They can then import that file in to their own application.", "<b>Reporting:</b> If you simply want to share the current state of your assessment with others, there are options available. Please see the section in this help text titled 'Can I generate a report of my assessment?'."] }, { helpType: "dmc", helpTitle: 'How can I share an assessment with others?', helpText: ["<b>Sharing and Editing:</b> If you want to allow others to open and edit your assessment in this application, you will need to give them access to your DMC workspace. Once they are able to access the workspace, they can run the Docent app and see any assessments you've saved in that workspace.", "<b>Reporting:</b> If you simply want to share the current state of your assessment with others, there are options available. Please see the section in this help text titled 'Can I generate a report of my assessment?'."] }, { helpTitle: 'Can I generate a report of my assessment?', helpText: ["<b>Graphic Summary:</b> Select the 'Dashboard' option from the 'Assessment' menu. Here you'll see a table outlining the various threads and subthreads and your status within them. You can also click 'save image' at the bottom of this page to export this table as an image.", "<b>Report of items requiring action:</b> Select the 'Action Items' option from the 'Assessment' menu. Here's you'll see a summary of all of the questions marked 'no' along with the answer information. You can export this to a csv format by clicking 'export.'", "<b>Report of all answered questions:</b> Select the 'Review' option from the 'Assessment' menu. Here, you'll see a summary of all questions you've answered. You can export this to a csv format by clicking 'export.'" ] }, { helpTitle: "What are the benefits of performing a Manufacturing Readiness Assessment?", helpText: ["Performing a Manufacturing Readiness Assessment is a key factor in identifying and mitigating manufacturing risks. Following the MRL Criteria will help to address problems before they end up in the production line. Docent will take you through the process of performing an assessment, and prompt you to create an action plan for any criteria that have not been met. These plans can be exported from Docent and used to develop a Manufacturing Maturation Plan."] }, { helpTitle: "What are the best practices for performing an assessment?", helpText: ["Choose an assessor to lead the team through the Manufacturing Readiness Assessment process. The assessor should identify a team of 4-8 subject experts and schedule a time and place to perform the assessment. Limiting the size of the assessment team will make it easier to reach consensus. The assessment should be done onsite to allow the team to view the manufacturing processes being assessed. Before the assessment, the assessor and members of the team can review the MRL criteria to gain familiarity with them. A crucial step of the assessment is defining the scope of the system or sub-system to be assessed. By defining the scope early on and setting clear limits about what is in or out of scope, the assessment will run smoothly."] }, { helpTitle: "What should my target level be?", helpText: ["The target levels are steps along the path to full rate production. The criteria are structured such that each level corresponds to a stage of manufacturing. Choose the stage that you are currently at and the MRL Criteria will guide you through the appropriate steps at this stage to prepare for the next stage.<br> <b>MRL 1:</b> Basic Manufacturing Implications Identified<br> <b>MRL 2:</b> Manufacturing Concepts Identified<br> <b>MRL 3:</b> Manufacturing Proof of Concept Developed<br> <b>MRL 4:</b> Capability to produce the technology in a laboratory environment<br> <b>MRL 5:</b> Capability to produce prototype components in a production relevant environment<br> <b>MRL 6:</b> Capability to produce a prototype system or subsystem in a production relevant environment<br> <b>MRL 7:</b> Capability to produce systems, subsystems, or components in a production representative environment<br> <b>MRL 8:</b> Pilot line capability demonstrated; ready to begin Low Rate Initial Production (LRIP)<br> <b>MRL 9:</b> Low rate production demonstrated; Capability in place to begin Full Rate Production (FRP)<br> <b>MRL 10:</b> Full Rate Production demonstrated and lean production practices in place"] }, { helpTitle: "How can I find questions I skipped?", helpText: ["Select the 'Skipped Questions' option from the 'Assessment' menu." ] }, { helpTitle: "How can I find questions I marked 'not applicable'?", helpText: ["Select the 'N/A Questions' option from the 'Assessment' menu." ] }];